import React from 'react';
import './sidenav.css';

export default function SideNav(props) {
    return (
        <div className='side-nav-bar'>
            <button id='composeMailBtn' onClick={() => props.composeMail()}>Compose</button>
            <ul>
                <li className="active">
                    Inbox
                    <span className='unread-mail' id='unreadMailInbox'>1</span>
                </li>
                <li>
                    Sent
                    <span className='unread-mail' id='unreadMailSent'></span>
                </li>
            </ul>
        </div>
    );
}
